public class ArrStr {

	/**
	 * @param args
	 */
	public void show(){
		String[] names={"Kiran","Sourab","Sushmitha","Kandarpa","Shruthi"};
		for(String s:names){
			System.out.println("\n" + s);
		}
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		ArrStr x=new ArrStr();
		x.show();
	}

}
